/*Table structure for table `ali_message_send_config` */

DROP TABLE IF EXISTS `ali_message_send_config`;

CREATE TABLE `ali_message_send_config` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(60) NOT NULL COMMENT '标题',
  `keyword1` varchar(60) NOT NULL,
  `keyword2` varchar(60) NOT NULL,
  `keyword3` varchar(60) NOT NULL,
  `keyword4` varchar(60) NOT NULL,
  `app_id` varchar(60) NOT NULL COMMENT 'app_id',
  `business_type` varchar(100) NOT NULL COMMENT 'businessType',
  `scence` varchar(100) NOT NULL COMMENT 'scene',
  `send_type` varchar(32) NOT NULL COMMENT '发送类型: LIFESTYLE, MINIAPP',
  `send_number` int(11) NOT NULL COMMENT '发送数量',
  `send_time` varchar(100) NOT NULL COMMENT '发送时间范围',
  `status` varchar(32) NOT NULL COMMENT '发送状态: SUCCESS, PROCESS,APPLY,FAIL,CLOSE',
  `url` varchar(500) NOT NULL COMMENT '小程序url',
  `create_time` datetime NOT NULL,
  `update_time` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_title` (`title`),
  KEY `idx_business_scene` (`business_type`,`scence`)
